import Navbar from './Navbar';
import Menu from './Menu';

const Login = () => {
	return (
		<div>
			<Navbar />
			<div className="container ">
				<div className="row-cols-1">
					<div className="m-auto col-12 col-sm-10 col-md-8 col-lg-6 col-xl-6 col-xxl-6">
						<div className="row" />
					</div>
				</div>
			</div>
			<Menu />{' '}
		</div>
	);
};

export default Login;
